$(document).ready(function(){$(".carousel").carousel();let n=n=>n.trim().length===0?undefined:n,t=new Vue({el:"#tabContent",data:{searchEntries:{entries:[],pages:0}},mounted:function(){this.categoriesCallback(1);$(".onChangeCallback").change(()=>this.categoriesCallback(1));$("#searchInput").keypress(this.searchCallback)},methods:{categoriesCallback:function(t){let i=this;axios.get(util.apiUrl(`/api/quiz/getList/search`,{page:t,size:global.quizCardAmount,difficulty:$("#difficultySelect option:selected").attr("value"),categoryIndex:$("#categorySelect option:selected").attr("value"),orderBy:$("#orderBySelect option:selected").attr("value"),search:n($("#searchInput").val())})).then(function(n){global.debug&&util.logResponse(n);i.searchEntries.entries=n.data.entries;i.searchEntries.pages=n.data.pages}).catch(function(n){util.logResponse(n)})},searchCallback:function(n){n.keyCode===13&&this.categoriesCallback(1)}}})});